sources.SiteFooter.styl:
.site-footer {
  color: #fff;
  background: #000;
}
.site-footer .site-footer-content {
  width: 980px;
  margin: auto;
}
.site-footer .site-footer-content .site-footer-contact {
  font-size: 14px;
  font-weight: 200;
  font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif, "Times New Roman", Times, serif;
  height: 58px;
  line-height: 58px;
  background: url("913c6c4c6138977c6ac4b99c548189c3.png");
  background-position: center;
}
.site-footer .site-footer-content .site-footer-contact .contact-left {
  padding-left: 30px;
  float: left;
  position: relative;
}
.site-footer .site-footer-content .site-footer-contact .contact-left .left-mail-icon {
  height: 15px;
  width: 15px;
  position: absolute;
  left: 5px;
  top: 50%;
  margin-top: -9px;
  background: url("86ed30c9ba338e8d48cc5b28acd64789.svg") center 40%/20px no-repeat;
  background-size: cover;
}
.site-footer .site-footer-content .site-footer-contact .contact-right {
  float: right;
  position: relative;
}
.site-footer .site-footer-content .site-footer-contact .contact-right .right-telephone-icon {
  height: 15px;
  width: 15px;
  position: absolute;
  left: 5px;
  top: 50%;
  margin-top: -9px;
  background: url("c8f70c48afaaa8e02682b6fb7d2ecb34.svg") center 40%/20px no-repeat;
  background-size: cover;
}
.site-footer .site-footer-content .site-footer-contact .contact-right .right-item {
  display: inline-block;
  padding-left: 20px;
}
.site-footer .site-footer-content .site-footer-contact .contact-right .right-item b {
  padding-left: 15px;
  padding-right: 15px;
}
.site-footer .site-footer-content .site-footer-join {
  width: 326px;
  float: left;
}
.site-footer .site-footer-content .site-footer-join .join-content {
  padding-top: 18px;
  padding-right: 10px;
}
.site-footer .site-footer-content .site-footer-join .join-content h1 {
  font-size: 44px;
  font-family: 'DubielItalic';
  padding: 0px;
  margin: 0px;
}
.site-footer .site-footer-content .site-footer-join .join-content h2 {
  font-size: 30px;
  font-family: 'DubielItalic';
  padding: 0px;
  margin: 0px;
  color: #989898;
}
.site-footer .site-footer-content .site-footer-join .join-content h2 .h2-brown {
  color: #b7aa85;
}
.site-footer .site-footer-content .site-footer-join .join-content p {
  font-size: 13px;
  font-weight: 200;
  font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif, "Times New Roman", Times, serif;
  line-height: 18px;
  margin: 0px;
  padding: 0px;
  width: 275px;
  padding-top: 5px;
  padding-bottom: 15px;
  opacity: 0.5;
}
.site-footer .site-footer-content .site-footer-join .join-content p .link-underline {
  text-decoration: underline;
}
.site-footer .site-footer-content .site-footer-join .join-content .join-form {
  position: relative;
}
.site-footer .site-footer-content .site-footer-join .join-content .join-form input[type="text"] {
  font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif, "Times New Roman", Times, serif;
  font-size: 12px;
  padding: 0px;
  width: 95%;
  padding-left: 5%;
  height: 40px;
  border: 0px solid #000;
  transition-property: border;
  transition-duration: 0.4s;
  transition-timing-function: ease-out;
  transition-delay: 0s;
  outline: none;
  border-radius: 5px;
  color: #000;
}
.site-footer .site-footer-content .site-footer-join .join-content .join-form .form-submit-button {
  font-size: 14px;
  font-family: 'DubielItalic';
  font-weight: normal;
  height: 32px;
  width: 80px;
  position: absolute;
  top: 4px;
  right: 11px;
  border: 0px;
  border-radius: 5px;
  color: #fff;
  background: #000;
}
.site-footer .site-footer-content .site-footer-social {
  width: 652px;
  float: right;
  border-left: 1px solid #303030;
}
.site-footer .site-footer-content .site-footer-social .social-content {
  padding-top: 18px;
  padding-bottom: 30px;
  padding-left: 25px;
}
.site-footer .site-footer-content .site-footer-social .social-content h1 {
  font-size: 44px;
  font-family: 'DubielItalic';
  padding: 0px;
  margin: 0px;
}
.site-footer .site-footer-content .site-footer-social .social-content h2 {
  font-size: 30px;
  font-family: 'DubielItalic';
  padding: 0px;
  margin: 0px;
  color: #989898;
}
.site-footer .site-footer-content .site-footer-social .social-content h2 .h2-brown {
  color: #b7aa85;
}
.site-footer .site-footer-content .site-footer-social .social-content p {
  font-size: 13px;
  font-weight: 200;
  font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif, "Times New Roman", Times, serif;
  line-height: 18px;
  margin: 0px;
  padding: 0px;
  width: 450px;
  padding-top: 5px;
  padding-bottom: 15px;
  opacity: 0.5;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-links {
  text-align: left;
  margin-top: -20px;
  padding-bottom: 5px;
  padding-left: 160px;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-links .social-link {
  display: inline-block;
  margin-right: 20px;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-links .link-facebook {
  height: 23px;
  width: 13px;
  background: #008000;
  background: url("a1f54c21869242bee46c2cab4c73555e.svg") center 40%/20px no-repeat;
  background-size: cover;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-links .link-twitter {
  height: 19px;
  width: 21px;
  background: #008000;
  background: url("3c3c9689f6e60bc0a5c648a788762fa1.svg") center 40%/20px no-repeat;
  background-size: cover;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-links .link-pinterest {
  height: 22px;
  width: 18px;
  background: #008000;
  background: url("a0f505ca3a34a9948fd4884ee04a41df.svg") center 40%/20px no-repeat;
  background-size: cover;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-links .link-instagram {
  height: 20px;
  width: 20px;
  background: #008000;
  background: url("b3d509e703a149acbcdb9ef68f474804.svg") center 40%/20px no-repeat;
  background-size: cover;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-links .link-youtube {
  height: 23px;
  width: 21px;
  background: url("1d6a3330beac11a47ca31d2dfa6db747.svg") center 40%/20px no-repeat;
  background-size: cover;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-column {
  font-size: 12px;
  font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif, "Times New Roman", Times, serif;
  font-weight: 200;
  padding-right: 30px;
  padding-top: 25px;
  padding-bottom: 25px;
  float: left;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-column div {
  cursor: pointer;
  padding-bottom: 8px;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-column div:hover {
  text-decoration: underline;
}
.site-footer .site-footer-content .site-footer-social .social-content .social-legal {
  font-size: 12px;
  font-weight: 200;
  padding-top: 8px;
  font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif, "Times New Roman", Times, serif;
  opacity: 0.5;
}
